ExprLine.OrigStr:
# get request mode
if (team_IsModeNew())
	GenSetString(Self.Parent, "RequestMode", Translate("TeamStatus_RequestModeClosed"));
elif (team_IsModeOpen())
	GenSetString(Self.Parent, "RequestMode", Translate("TeamStatus_RequestModeOpen"));
elif (team_IsModeClosed())
	GenSetString(Self.Parent, "RequestMode", Translate("TeamStatus_RequestModeClosed"));
elif (team_IsModeRequest())
	GenSetString(Self.Parent, "RequestMode", Translate("TeamStatus_RequestModeRequest"));
else
	GenSetString(Self.Parent, "RequestMode", "");
endif

# get loot mode and threshold
GenSetString(Self.Parent, "LootMode", TranslateStaticDefineInt("LootMode", team_GetLootMode()));
GenSetString(Self.Parent, "LootThreshold", TeamLoot_GetQualityStr());

# get sidekicking mode
if (team_IsSidekicking())
	GenSetString(Self.Parent, "SidekickMode", Translate("TeamStatus_SidekickOn"));
else
	GenSetString(Self.Parent, "SidekickMode", "");
endif

# get teaming bonus
GenSetValue(Self.Parent, "TeamBonus", Int((Team_GetTeamXPMultiplier(GenListSize(List)) - 1) * 100));

Translate("TeamStatus_Tooltip");

DeclareType("RowData", "TeamMemberData");
GenSetString(Gen("EntityContextMenu"), "Name", EntGetName(RowData.Ent));
GenSetString(Gen("EntityContextMenu"), "AtName", "@");
GenAppendString(Gen("EntityContextMenu"), "AtName", EntGetDisplayName(RowData.Ent));
GenSetValue(Gen("EntityContextMenu"), "EntContainerID", RowData.Ent.myContainerID);
GenSetValue(Gen("EntityContextMenu"), "entref", EntGetRef(RowData.Ent));
GenSendMessage(Gen("EntityContextMenu"), "Popup");

if (RowData.NonLocal)
	GenSetValue(Self, "Level", RowData.ExpLevel);
else
	GenSetValue(Self, "Level", EntGetLevelCombat(RowData.Ent));
endif
if (Abs(Self.Var[Level].Int-EntGetLevelCombat(Player)) >= 5
    and Team_GetAutoSidekick()
    and not Team_IsSideKicking()
    and ((not Gen("TeamStatus_Root").Var[MostRecentChampionID].Int = RowData.Ent.MyContainerID)
    	 or (not Gen("TeamStatus_Root").Var[MostRecentTeamID].Int = RowData.Ent.pTeam.iTeamID)))

	GenSetString(Gen("TeamStatus_SidekickPrompt"), "Champion", EntGetName(RowData.Ent));
	GenSetValue(Gen("TeamStatus_SidekickPrompt"), "ChampionLevel", Self.Var[Level].Int);
	GenSetValue(Gen("TeamStatus_Root"), "MostRecentChampionID", RowData.Ent.myContainerID);
	GenSetValue(Gen("TeamStatus_Root"), "MostRecentTeamID", RowData.Ent.pTeam.iTeamID);
	GenSetValue(Gen("TeamStatus_Root"), "SidekickPrompt", true);
endif
